import string
def parse_nested_parens(group: str) -> int:
    depth = 0
    parse_nested_parens = 0
    for char in group:
        if char == '(':
            depth += 1
            parse_nested_parens = max(parse_nested_parens, depth)
        elif char == ')':
            depth -= 1
    return parse_nested_parens

